import React from "react";
import wallet from "../img/wallet.svg"

const AddWallet = function() {
    return (
        <div className="settings">
            <img src={wallet} alt="Lang"/>
            <p>Connect wallet</p>
        </div>

    )
}
export default AddWallet;
